import React from 'react';

const BrandLegendListbox: React.FC = () => {
  // Dummy data for legend
  const legendItems = [
    { name: 'My Brand - [brand name]', color: 'text-blue-600' },
    { name: '[Competitor brand name]', color: 'text-orange-500' },
    { name: '[Competitor brand name]', color: 'text-green-500' },
    { name: '[Competitor brand name]', color: 'text-yellow-500' },
    { name: '[Competitor brand name]', color: 'text-gray-400' },
    { name: '[Competitor brand name]', color: 'text-gray-400' },
    { name: '[Competitor brand name]', color: 'text-gray-400' },
    { name: '[Competitor brand name]', color: 'text-gray-400' },
    { name: 'All Other Brands', color: 'text-gray-400' },
  ];

  return (
    <div className="bg-white p-4 rounded-lg border border-border-gray w-64">
      <div className="space-y-2">
        {legendItems.map((item, index) => (
          <div key={index} className="flex items-center gap-2 text-sm">
            <input type="checkbox" defaultChecked className={`form-checkbox ${item.color}`} />
            <span className="text-text-dark">{item.name}</span>
          </div>
        ))}
      </div>
      <div className="mt-4 pt-2 border-t border-border-gray flex justify-between items-center text-xs">
        <button className="text-primary-blue font-bold">Select Top Competitors</button>
        <span className="text-text-secondary">4/6</span>
      </div>
    </div>
  );
};

export default BrandLegendListbox;
